        },
        "remark" : {
          "nb" : "Fra skatte abc: 4.2.3 ENGANGSUTBETALING TIL DØDSBO\nPersoninntekt fastsettes aldri for dødsbo. Dette gjelder tilsvarende for engangsutbetalinger fra individuell pensjonsavtale (IPA), jf. FSFIN § 6-47-6 tredje ledd, og engangsbeløp fra en individuell pensjonsordning (IPS) som eventuelt tilfaller dødsboet, jf. lov om individuell pensjonsordning § 2-8 tredje ledd. Det samme gjelder engangsbeløp til dødsboet etter innskuddspensjonsloven, jf. innskuddspensjonsloven § 7-4 fjerde ledd. Imidlertid skal slike engangsutbetalinger til bo beskattes med en særskilt sats, jf. sktl. § 5-40 fjerde ledd og SSV § 3-7."
        },
