          }
        } ]
      },
      "subject" : {
        "nb" : "Formues- og inntektsskatt"
      },
      "prefLabel" : {
        "nb" : "skattemessig bosatt i utland"
      },
      "altLabel" : [ ],
      "hiddenLabel" : [ ],
      "contactPoint" : {
        "email" : "begrepskatalogen@skatteetaten.no"
      },
      "example" : {
        "nb" : "Hvis du arbeider eller oppholder deg i et annet nordisk land over en viss tid blir du skattemessig bosatt og fullt skattepliktig i oppholdslandet etter dette landets interne regler. Samtidig kan du fortsatt være skattemessig bosatt og fullt skattepliktig i det landet der du bor eller som du har flyttet fra. Om du er fullt skattepliktig i to land vil du i utgangspunktet være skattepliktig i begge land for samme inntekt og formue. I slike tilfeller er det viktig å få avklart i hvilket land du skal anses bosatt etter bestemmelsene i den nordiske skatteavtalen.\nHvor du er bosatt etter skatteavtalen vil ha betydning for hvilket land som kan beskatte inntekt og formue. Du vil være fullt skattepliktig i det landet der du anses bosatt etter skatteavtalen. Det andre landet kan bare beskatte visse inntekter. Det er reglene i skatteavtalen som bestemmer hvilke inntekter som skal beskattes i kildestaten/arbeidsstaten. Når en inntekt kan beskattes både i kildestaten/arbeidsstaten og i bostedsstaten, er det bostedsstaten som skal avhjelpe den dobbeltbeskatning som dette fører til.\nEtter bestemmelsene i skatteavtalen skal du anses bosatt i det land der du disponerer fast bolig. Det har ingen betydning om du eier boligen eller om du leier den. Har du fast bolig i begge land, skal du anses bosatt i det land der du har dine sterkeste personlige og økonomiske forbindelser (sentrum for livsinteressene). Med personlig og økonomiske forbindelser menes f.eks. familie (ektefelle og hjemmeværende barn under 18 år) og øvrige sosiale forbindelser samt arbeid og andre økonomiske interesser. Om dette ikke gir noe klart svar, skal du anses bosatt i det landet hvor du har vanlig opphold."
      },
