          "nb" : "arbeidsoppdrag der den skattepliktige ikke får lønn, men eventuelt mottar en frivillig pengestøtte fra frivillig bidragsyter i nær familie"
        },
        "remark" : {
          "nb" : "Bakgrunnen for denne posten er at noen personer arbeider frivillig i hel- eller deltidsstilling for en organisasjon, uten at de mottar lønn direkte fra organisasjonen. \"Avlønningen\" er i stedet basert på at frivillige bidragsytere gir pengestøtte eller gaver direkte til den enkelte medarbeider til dekning av livsopphold.  Skattedirektoratet har fastsatt retningslinjer til skattekontorene om hvordan reglene skal praktiseres. I retningslinjene skilles det ut en klart identifiserbar givergruppe bestående av nær familie hvor det generelt kan legges til grunn at giver har hatt gavehensikt som gjør gaven skattefri. Utgangspunktet er at gaver og pengestøtte fra andre enn nær familie anses å være gitt for å støtte det arbeidet som mottakeren utøver i organisasjonen. Gaver fra denne givergruppen må således normalt behandles som skattepliktig lønn. Post 1.5.3 er tilført for at skattekontoret \nden enkelte medarbeider til dekning av livsopphold.  Skattedirektoratet har fastsatt retningslinjer til skattekontorene om hvordan reglene skal praktiseres. I retningslinjene skilles det ut en klart identifiserbar givergruppe bestående av nær familie hvor det generelt kan legges til grunn at giver har hatt gavehensikt som gjør gaven skattefri. Utgangspunktet er at gaver og pengestøtte fra andre enn nær familie anses å være gitt for å støtte det arbeidet som mottakeren utøver i organisasjonen. Gaver fra denne givergruppen må således normalt behandles som skattepliktig lønn."
