      "definition" : {
        "text" : {
          "nb" : "enhver innretning som kan flyttes fra anlegg til anlegg og som etter sin art kan karakteriseres som anleggsmaskin"
        },
        "remark" : {
          "nb" : "Gjelder anleggsmaskiner etter panteloven § 3-8.\n\nI Skoghøy sin kommentarutgave til panteloven nevner han en del eksempler på hva som kan være anleggsmaskiner: heisekraner, transportbånd, taubaner og ulike former for skinnegående redskaper, samt kompressorer, sementblandemaskiner og steinknusermaskiner uten eget fremdriftsmaskineri. Enkle redskaper (håndsager, hammere og lignende) faller utenfor, ettersom disse ikke er mekanisk virkende. Det stilles dessuten visse minstekrav til størrelsen, slik at elektrisk drevne håndsager, driller og spikerpistoler antakeligvis faller utenfor."
        },
        "source" : {
          "prefLabel" : {
