        },
        "remark" : {
          "nb" : "Den som har panterett vil ha en eksklusiv særrett til å søke dekning for sitt krav i formuesgodet, til fortrengsel for eierens øvrige rettighetshavere. Dersom pantsetter misligholder pantekravet, kan panthaveren med myndighetenes bistand gjennom tvangsfullbyrdelse selge formuesgjenstanden, og ta dekning for sitt krav i salgssummen. Begrunnelsen for å tillate pantsettelse er i hovedsak panterettens kredittskapende effekt. Kreditt gir grunnlag for investeringer, og dermed avkastning. Dette er gunstig for den enkelte og for samfunnet."
