      "definition" : {
        "text" : {
          "nb" : "det beløpet som fremkommer etter at skattesatser er anvendt på beregningsgrunnlaget."
        },
        "remark" : {
          "nb" : "Etter skatteforvaltningsloven skal det etter fastsetting av skattegrunnlaget (§ 9-1) og beregning av skatten (§ 9-2), foretas et skatteoppgjør (§ 9-3). Loven angir ikke hva som faktisk ligger i beregning av skatt. Det finnes ingen legaldefinisjon av \"beregnet skatt\" eller \"skatteberegning\". Skatteetaten definerer begrepet \"beregnet skatt\" som \"resultatet av skatteberegningen\", men dette er en definisjon som biter seg i halen, da begrepet \"skatteberegning\" heller ikke er definert. \"Beregnet skatt\" er det beløpet som beregnes og som skattyter som utgangspunkt må betale etter skatteberegningsreglene, men er ikke nødvendigvis det samme beløpet som skattyter til slutt faktisk må betale, da det finnes regler om fradrag i (beregnet) skatt (kalt skattefradrag), skattebegrensning og skattenedsettelse."
