        },
        "remark" : {
          "nb" : "Det gis inntektsfradrag for tilskudd til institutt som under medvirkning av staten forestår vitenskapelig forskning eller yrkesopplæring som har betydning for dem skattepliktige i hennes/hans ervervsvirksomhet eller for hennes/hans bransje. Det er et vilkår at Stortinget eller et departement har rett til å oppnevne ett eller flere styremedlemmer til instituttet. Instituttet må selv søke skattekontoret om forhåndsgodkjenning. En søknad skal inneholde instituttets vedtekter, og det må fremgå av disse at et departement (eventuelt Regjeringen eller Stortinget) er gitt adgang til å oppnevne en representant til instituttets styre. Vedtektene må også bestemme at overskytende midler ved en eventuell oppløsning skal anvendes i overensstemmelse med instituttets formål. Videre bør det redegjøres for instituttets aktivitet og for øvrig på hvilket grunnlag vilkårene i § 6-42 anses oppfylt"
