          "nb" : "Test av en verdikjede med fokus på arbeidsprosess/arbeidsflyt og/eller transaksjonsflyt. Man tester da hendelsen/transaksjonen fra den oppstår eller kommer inn i systemet til den er ferdig behandlet og eventuell informasjon er sendt tilbake til innleverende system eller bruker.\n\nProsjektet må selv definere hvor ende-til-ende-testen skal starte og stoppe. Den kan f.eks. stoppe ved at systemet prosjektet lager har ferdigbehandlet transaksjonen og gjort den tilgjengelig til neste system, eller den kan omfatte behandling i flere sekvensielle systemer. Fokuset i en ende-til-ende-test bør være å teste en forretningsprosess fra start til slutt, på tvers av ulike virksomhetsområder og applikasjoner.\n\nEnde-til-ende-test blir også kalt verdikjedetest, men da tenker man oftest på \"hele verdikjeden\" og ikke bare deler av den."
