          "nb" : "særfradrag til barn som er 16 år eller yngre ved utgangen av inntektsåret skal i utgangspunktet gå til fradrag i barnets øvrige inntekter. Eventuelt udekket særfradrag fradras hos foreldrene såfremt vedkommende skattlegges under ett med barnet. Har forsørgeren dekket kostnadene, skal fradraget tilordnes forsørgeren. Barnets særfradrag fordeles med en halvpart på hver av ektefellene. Særfradrag som tilhører særkullsbarn, tilordnes den ektefellen som er barnets mor eller far. Er ektefellene enige om en annen fordeling, skal denne legges til grunn."
